  [],\n\t\"revision_timestamp\": \"2016-02-26T22:17:11.694066\",\n\t\"name\": \"output-fields-from-the-noaa-atlantic-real-time-ocean-forecast-system-rtofs-for-2015-07-01-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The NOAA Atlantic Real-Time Ocean Forecast
  System (RTOFS) dataset comprises output fields from the daily operational RTOFS
  model runs conducted at the National Centers for Atmospheric Prediction. Each model
  run produces a series of gridded fields containing results of model computations
  for ocean temperature, salinity, currents, sea-surface height, and possibly other
  properties. The fields are encoded in the standard GRIdded Binary (GRIB) file format.
  NCEI compiles a series of files into monthly accessions to facilitate archival storage
  and public access. Two different sets of output fields are included: 1) daily 3-dimensional
  fields reported on the model's native hybrid (isopycnal plus z-level) vertical coordinates
  (note: prior to June 6, 2007, these fields are interpolated to z-levels); and 2)
  hourly fields reported for the surface level only. Each daily model run produces
